import React, { Component } from 'react';
import styled from "styled-components";

const Screen = styled.div`

  h1 {
    text-align: center;
    width: 100%;
    animation-name: hoverBlue;
    animation-duration: 1s;
  }

  h1:hover {
    color: yellow
  }

  @keyframes hoverBlue {
    0% {
      color: black
    }
    100% {
      color: blue
    }
  }

`

const HomeScreen = props => {
    return (
        <Screen>
            <h1>Test</h1>
        </Screen>
    )
  }

export default HomeScreen
